import { useState, useEffect } from "react";

const useLogout = () => {
  const [loggedOut, setLoggedOut] = useState(false);
  useEffect(() => {
    fetch("/logout")
      .then((res) => res.json())
      .then((data) => {
        setLoggedOut(data.logged_out);
      });
  }, []);
  return loggedOut;
};

export default useLogout;
